import React from "react";
import NotesIcon from '@material-ui/icons/Notes';

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCircleQuestion } from "@fortawesome/free-solid-svg-icons";

function Header() {

    function alert(){
        alert("Notes is the best place to jot down quick thoughts or to save longer notes filled with checklists");
    }

    return (
    <header>
        <h1><NotesIcon />Notes <FontAwesomeIcon onClick={alert} className="faCircleQuestion fa-beat" icon={faCircleQuestion}/></h1>
    </header>
    )
}

export default Header;
